import React from 'react';
import Login from "./components/login";
import { BrowserRouter, Route, Link } from 'react-router-dom'


function App() {
  return (
  <div>

   <BrowserRouter>
    <div>

      <Route path='/login' component={Login} />
    </div>
  </BrowserRouter>

    <div className="App">
      <Login />
    </div>
    </div>
  );
}

export default App;
